CREATE DATABASE BDSalonDeBelleza;
GO

USE BDSalonDeBelleza;


CREATE TABLE Clientes(
	Id int primary key IDENTITY(1,1),
    Nombre varchar(30),
    Telefono varchar(30),
    Correo varchar(30),
	Cumpleaños Date,
	[Ultima Visita] Date,
	[Estilista Favorito] varchar(30)
);


CREATE TABLE Empleados (
	Id int primary key IDENTITY(1,1),
	Cédula varchar(30),
	Nombre varchar(30),
	Generado int,
	Comisión int
);


CREATE TABLE Servicios (
	Id int primary key IDENTITY (1,1),
	Vinculo int,
	Nombre varchar(30),
	Valor int,
	Duracion int,
	Regreso date
);
GO




